style.css:
/* Set the background color on http://www.example.com/test.html */
@-moz-document url-prefix('http://www.example.com/test.html') {
  body {
    background-color: black !important;
  }
}

/* Set the background image on https://roblox.com */
@-moz-document domain("roblox.com") {
  body {
    background-image: url('https://cdn.discordapp.com/attachments/1096877699995291669/1136638720636895252/slidemeup.jpg'); /* Replace with your image file path */
    background-repeat: no-repeat;
    background-size: cover;
    background-position: center center;
  }
}
